import { useState} from 'react'

export default function MenuButton()  {

    const [position, setPosition] = useState({transform: [{rotateY: '0'}]})

    let rotateButton = () => {
        if(position == {transform: [{rotateY: '0'}]}){
            setPosition({
                transform: [{rotateY: '0'}],
                timeout: '200ms',
            })
        } else {
            setPosition({
                transform: [{rotateY: '0'}],
                transition: '200ms',
            })
        }
    }

    return (
        <>
            <svg class="h-12 w-12 text-black-500"  width="24" height="24" viewBox="0 0 24 24" stroke-width="2" 
              stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round">  
                <path stroke="none" d="M0 0h24v24H0z"/>  
